# Functions
def abs(x):
    return math.fabs(x)

def acos(x):
    return math.acos(x)

def acosh(x):
    return math.acosh(x)

def asin(x):
    return math.asin(x)

def asinh(x):
    return math.asinh(x)

def atan(x):
    return math.atan(x)

def atan2(y, x):
    return math.atan2(y, x)

def atanh(x):
    return math.atanh(x)

def ceil(x):
    return math.ceil(x)

def comb(n, k):
    return math.comb(n, k)

def copysign(x, y):
    return math.copysign(x, y)

def cos(x):
    return math.cos(x)

def cosh(x):
    return math.cosh(x)

def degrees(x):
    return math.degrees(x)

def dist(p, q):
    return math.dist(p, q)

def erf(x):
    return math.erf(x)

def erfc(x):
    return math.erfc(x)

def exp(x):
    return math.exp(x)

def expm1(x):
    return math.expm1(x)

def sin(x):
    return math.sin(x)

def sinh(x):
    return math.sinh(x)

def sqrt(x):
    return math.sqrt(x)

def tan(x):
    return math.tan(x)

def tanh(x):
    return math.tanh(x)

def trunc(x):
    return math.trunc(x)

def factorial(x):
    return math.factorial(x)

def floor(x):
    return math.floor(x)

def fmod(x, y):
    return math.fmod(x, y)

def frexp(x):
    return math.frexp(x)

def fsum(iterable):
    return math.fsum(iterable)

def gamma(x):
    return math.gamma(x)

def gcd(x, y):
    return math.gcd(x, y)